Actionscript.script:
ChangeFrame = function () {
	gotoAndPlay(_parent._parent.Mood);
};
Skip = function (a) {
	gotoAndPlay(random(a)+_currentframe);
};
ChangeFrame();
if (_parent._parent.Mood == undefined) {
	gotoAndStop(2);
}

mo = _parent._parent.Mood;
onEnterFrame = function () {
	if (mo !== _parent._parent.Mood) {
		ChangeFrame();
		onEnterFrame = null;
	}
	mo = _parent._parent.Mood;
};
